INSERT INTO `aiml` VALUES(78439, 1, '<category><pattern>WHAT IS RELIGION</pattern><template>A system of religious belief. Belief in a divine or superhuman power or powers to be obeyed and worshipped as the creator(s) and ruler(s) of the universe. Any system of beliefs, practices, ethical values, etc. resembling, suggestive of, or likened to such a system.</template></category>', 'WHAT IS RELIGION', '', 'A system of religious belief. Belief in a divine or superhuman power or powers to be obeyed and worshipped as the creator(s) and ruler(s) of the universe. Any system of beliefs, practices, ethical values, etc. resembling, suggestive of, or likened to such a system.', '', 'religion.aiml', '');
